import React from "react";
import styled from "styled-components";

const DateTitle = styled.h4`
font-family:arial;
color:#A9B0B8;
width:27%;
text-align:right;
font-size:1px
`

const RangeDisplay = (props) =>{
    return(
        <>
        <DateTitle>{props.startDate + props.endDate}</DateTitle>
        </>
    )
}

export default RangeDisplay;
